import React from 'react';

export default function Contato() {
  return (
    <section>
      <h2>Contato</h2>
      <p>Telefone: (11) 99999-9999</p>
      <p>Email: contato@smilecare.com</p>
      <iframe
        src="https://www.google.com/maps/embed?pb=!1m18!"
        width="100%"
        height="300"
        style={{ border: 0 }}
        allowFullScreen=""
        loading="lazy"
        title="Localização da clínica"
      ></iframe>
    </section>
  );
}
